import React from "react";
import { connect } from "react-redux";
import { GetDataFromApi} from "../utils/session";
import { useState } from 'react';
import { useEffect } from "react"

const mapStateToProps = ({ session }) => ({
  session
});

const App = ({ session }) => {
    const [data, setData] = useState([]);
    useEffect(() => {
      GetDataFromApi(session.username).then((response) => setData(response));
    }, []);
    let name = data?.name;
    console.log(name)
    const [textAddValue, updateInput] = useState(name);
    const addNewText = () =>{
      if(!textAddValue){ 
        alert('input empty'); 
        return;
      } 
    }

    return (
      <div className="App">
          <div className="container">
              <div className="eleContainer">
                <input type="text" className="txtAdd" value={textAddValue} onChange={(e)=>updateInput(e.target.value)}/>
                <button className="addNew" onClick={addNewText}>Add to Dictionary</button>
              </div>
          </div>
      </div>
    );
  }
  export default connect(
    mapStateToProps
  )(App);
